// File: peterpan.sol



pragma solidity ^0.8.0;




contract PeterPan is ERC20, Ownable {
    address payable public devWallet; // 0x2a2982864042FE3cB20ee0b79A114139F628FB90
    uint256 public maxBuy;
    uint256 public taxRate = 0; // 0% tax rate
    uint256 public burnRate = 0; // 0% burn rate
    uint256 public tokensPerETH = 0; // default rate is 1000 PAN per ETH
    uint256 public maxTransferAmount = 10000000 * 10 ** decimals();

    mapping(address => bool) public whitelist;

    IUniswapV2Router02 public uniswapV2Router;

    constructor() ERC20("Peter Pan", "PAN") {
        devWallet = payable(msg.sender);
        maxBuy = 500000000000000000; // 0.5 ETH max buy limit
        _mint(msg.sender, 469000000 * 10 ** decimals());
    }

    function setUniswapV2Router(address _router) external onlyOwner {
        uniswapV2Router = IUniswapV2Router02(_router);
    }

    function buy() public payable {
        require(msg.value <= maxBuy, "Exceeds max buy limit");
        require(whitelist[msg.sender], "Buyer not in whitelist");
        uint256 tokens = (msg.value * tokensPerETH) / (10 ** decimals());
        _transfer(address(this), msg.sender, tokens);
        uint256 taxAmount = (tokens * taxRate) / 100;
        uint256 burnAmount = (tokens * burnRate) / 100;
        super._transfer(address(this), devWallet, taxAmount);
        _burn(address(this), burnAmount);
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual override {
    require(amount <= maxTransferAmount, "Exceeds maximum transfer amount");
    if (sender != address(0) && recipient != address(0) && recipient != address(this)) {
        if (recipient != address(uniswapV2Router)) {
            uint256 taxAmount = (amount * taxRate) / 100;
            uint256 burnAmount = (amount * burnRate) / 100;
            super._transfer(sender, devWallet, taxAmount);
            super._transfer(sender, address(this), burnAmount);
            amount -= taxAmount + burnAmount;
            super._transfer(sender, recipient, amount);
        } else {
            // Transfer tokens to the Uniswap V2 router
            super._transfer(sender, recipient, amount);
            // Convert PAN tokens to ETH and send the ETH to the devWallet
            address[] memory path = new address[](2);
            path[0] = address(this);
            path[1] = uniswapV2Router.WETH();
            uint256 taxAmount = (amount * taxRate) / 100;
            super.approve(address(uniswapV2Router), taxAmount);
            uniswapV2Router.swapExactTokensForETH(taxAmount, 0, path, devWallet, block.timestamp);
